function nano_updateFolder(b,c,a){document.getElementById("id_folder").value=c;document.getElementById("foldername").value=a;$("#treeview_inner a").removeClass("active");b.classList.add("active")}function nano_initFolder(a){$("#treeview_inner a").removeClass("active");$("#treeview_node"+a+" a")[1].classList.add("active")}var sliders={};var clrs={};function uiReset(){resetSliders();resetColors()}function resetSliders(){for(var b in sliders){var a=sliders[b];$("#"+b).slider("value",a)}}function resetColors(){for(var b in clrs){var a=clrs[b];$("#"+b).spectrum("set",a)}};